import { useState } from 'react';


const fetchedData = (props) => {
    return (
        <div>
            {props.responseObj.cod === 200 ?
            <div>
                <p> In {props.responseObj.name}, it is currently {props.responseObj.main.temp}.</p>
            </div>
            : null}
        </div>
    )
}

export default fetchedData;
